import React from "react";
import { Router, Route, RouteHandler } from "react-router";
import { Link } from "react-router-dom";
import "../App.css";
import "../routes/routes";
import { useState } from "react";
import { Button, FormGroup, FormControl, FormLabel } from "react-bootstrap";
import { render } from "@testing-library/react";
import logo from "../logo.png";
import App from "../App";

export default function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function validateForm() {
    return email.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
    try {
      alert("Logged in");
    } catch (e) {
      alert(e.message);
    }
  }

  return (
    <div className="App">
      <h1 className="App-h1">
        <img src={logo} className="App-logo-static" alt="logo" />
      </h1>
      <p className="App-p">Korisnicki login</p>
      <form onSubmit={handleSubmit} className="App-form-lr">
        <FormGroup controlId="email" bsSize="large">
          <FormLabel className="App-label">Email</FormLabel>
          <FormControl
            autoFocus
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
        </FormGroup>
        <FormGroup controlId="password" bsSize="large">
          <FormLabel className="App-label">Password</FormLabel>
          <FormControl
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            type="password"
          />
        </FormGroup>
        <Button
          className="App-button"
          block
          bsSize="large"
          disabled={!validateForm()}
          type="submit"
        >
          Login
        </Button>
      </form>
    </div>
  );
}
